import React from "react";
import { useNavigate } from "react-router-dom";

function MenuUsuario() {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Limpiar sesión
    localStorage.removeItem("id_sesion");
    localStorage.removeItem("nombre_usuario");
    localStorage.removeItem("role");
    navigate("/login");  // Redirige al login
  };

  return (
    <div>
      <h1>Menú Usuario</h1>
      <ul>
        <li>
          <button onClick={() => navigate("/mis-interacciones")}>Revisar Mis Interacciones</button>
        </li>
        <li>
          <button onClick={() => navigate("/chatbot")}>Interactuar con Chatbot</button>
        </li>
        <li>
          <button onClick={() => navigate("/gestionar-cuenta")}>Gestionar Mi Cuenta</button>
        </li>
        <li>
          <button onClick={handleLogout}>Cerrar Sesión</button>
        </li>
      </ul>
    </div>
  );
}

export default MenuUsuario;
